$linkedData:
  term: AgricultureCanineCard
  '@id': https://w3id.org/traceability#AgricultureCanineCard
title: Agriculture Canine Card
tags:
  - Agriculture
  - Other
description: |
  This is a small credential for testing embedded images.
  See: https://www.cbp.gov/document/guides/agriculture-canine-cards
type: object
properties:
  '@context':
    type: array
    readOnly: true
    const:
      - https://www.w3.org/2018/credentials/v1
      - https://w3id.org/traceability/v1
    default:
      - https://www.w3.org/2018/credentials/v1
      - https://w3id.org/traceability/v1
    items:
      type: string
      enum:
        - https://www.w3.org/2018/credentials/v1
        - https://w3id.org/traceability/v1
  type:
    type: array
    readOnly: true
    const:
      - VerifiableCredential
      - AgricultureCanineCard
    default:
      - VerifiableCredential
      - AgricultureCanineCard
    items:
      type: string
      enum:
        - VerifiableCredential
        - AgricultureCanineCard
  id:
    type: string
    format: uri

  issuanceDate:
    type: string
    format: date-time
  issuer:
    type: object
    properties:
      id:
        type: string
        format: uri
      name:
        type: string
      image:
        type: string
  credentialSubject:
    type: object
    properties:
      type:
        type: array
        readOnly: true
        const:
          - Dog
        default:
          - Dog
        items:
          type: string
          enum:
            - Dog
      name:
        type: string
      city:
        type: string
      state:
        type: string
      image:
        type: string
      breed:
        type: string
      specialization:
        type: string
      notableSeizures:
        type: string
      favoriteOdor:
        type: string
      previousLifeExperience:
        type: string
      yearStarted:
        type: number
    additionalProperties: false
    required:
      - type
      - name
      - city
      - state
      - image
      - breed
      - specialization
      - notableSeizures
      - favoriteOdor
      - previousLifeExperience
      - yearStarted
  proof:
    type: object
    properties:
      type:
        type: string
        description: Signature suite for the proof
        enum:
          - Ed25519Signature2018
      created:
        description: Creation timestamp for the proof in the form of an XML datestring
        type: string
      verificationMethod:
        description: The fragment from which the public key can be de-referenced, in the form of a URI
        type: string
      proofPurpose:
        description: For credentials, the proof should be the constant, 'assertionMethod'. For other uses, see https://w3c.github.io/vc-data-integrity/#proof-purposes.
        const: assertionMethod
      jws:
        description: The JSON Web Signature for the proof
        type: string
    additionalProperties: false
    required:
      - type
      - created
      - proofPurpose
      - jws
  credentialSchema:
    type: object
    properties:
      id:
        title: Id
        description: The url of the schema file to validate the shape of the json object
        type: string
        format: uri
        example: https://w3id.org/traceability/openapi/components/schemas/credentials/AgricultureCanineCard.yml
        default: https://w3id.org/traceability/openapi/components/schemas/credentials/AgricultureCanineCard.yml
        readOnly: true
      type:
        title: Type
        description: The type of validation to be run against the defined schema
        const: OpenApiSpecificationValidator2022
    additionalProperties: false
    required:
      - id
      - type
additionalProperties: false
required:
  - '@context'
  - id
  - type
  - issuanceDate
  - issuer
  - credentialSubject
  - credentialSchema
